style.css:
/* Unvisited link */
a:link {
    color: #e497ec; /* Light purple */
}

/* Visited link */
a:visited {
    color: #ec97e7; /* Pinkish purple */
}

/* Hovered link */
a:hover {
    color: #ec97e7; /* Pinkish purple */
}

/* Active link */
a:active {
    color: #ec97e7; /* Pinkish purple */
}
